function Scheduler() {
  return (
    <div className="scheduler">
      <table>
        <thead>
          <tr>
            <th>times</th>
            <th>Monday</th>
            <th>Tuesday</th>
            <th>Wednesday</th>
            <th>Thurday</th>
            <th>Friday</th>
          </tr>
        </thead>
      </table>
    </div>
  );
}

export default Scheduler;
